डा सि के राउतको अन्तर्वाता पहिलो पटक सुनेको हु। कतिपय थाहा नभएका कुराहरु थाहा भयो। वहाकै अन्तरवार्तलाको अाधारमा वहालाई मेरो केहि सिदा सादा सुझावहरु छन्;
तपाईले उठाउनु भएका तराईमा महिलाहरु माथि भईरहेका हिंसाहरुको कुरा र हालसालै वारामा आँधिवेरी पिडितले भोगेका कुरा ठिक  हो।

तर तपाईले अमेरिकाको हाईफाई र सोफेस्टिकेटिड जिवन त्यागेर आफ्नो गाउँको विकाश गर्ने उदेश्यका कारण फर्कनु भएको हो भन्ने कुराको मलाई त विस्वास छैन्। किनकी अमेरिकाले जे गर्छ त्यो विश वर्ष पछिको टारगेट गरेर आफ्नो प्लान अगाडि सार्छ। मलाई लाग्छ अमेरिकाले तराईमा भएको केही कमजोरिलाई क्यास गर्दै तपाई लाई उसले नेपालमा राजनिति गर्न पठाएको हो। तर तपाई कुनै समयमा जोगि हुन खोज्नु भएको कारण तपाईको अन्तरआत्मा नै जागेर देश र जनताको लागि केही गर्नै पर्छ भन्ने चेतना आयो भने अर्कै कुरा हो, हैन भने तपाई लाई यो देशको हितमा अमेरिकाले काम गर्न दिदैन।
